import React from 'react';

import './input.scss';

type Props = JSX.IntrinsicElements['input'] & {
    title?: string;
}

const Button : React.FC<Props> = ({
    title,
    ...rest
}) => { 
    return(
        <input {...rest} className="input-component"/>
    );
}

export default Button;
